import React, {Component} from 'react';

import './Cell.css';

class Cell extends Component {
    
    render() {
        const {
            col,
            isFinish,
            isStart,
            isWall,
            hasWeight,
            onMouseDown,
            onMouseEnter,
            onMouseUp,
            row,
          } = this.props;
          const extraClassName = isFinish
                ? 'cell-finish'
                : isStart
                ? 'start'
                : isWall
                ? 'cell-wall'
                : '';
        return(

            <div className = 'cell'
            id={`cell-${row}-${col}`}
            className={`cell ${extraClassName}`}
            onMouseDown={() => onMouseDown(row, col)}
            onMouseEnter={() => onMouseEnter(row, col)}
            onMouseUp={() => onMouseUp()}>

            </div>

        );
    }
    
}
export default Cell;
